import React from "react";
import walkingMan from "./media/sapiens(1).png";

function App() {
  return (
    <div className="min-h-screen mx-auto p-10 flex text-center items-center justify-center align-items">
      <div className="flex grid grid-cols-2">
        <img src={walkingMan} alt="Walking man" />

        <div className="font-light uppercase tracking-widest text-xl">
          Coming soon
        </div>
      </div>
    </div>
  );
}

export default App;
